import { useState } from "react";

export default function Board() {
  const [value, setValue] = useState(Array(9).fili(null));
  return (
    <>
      <div className="board-row">
        <Square value={[0]} />
        <Square value={[1]} />
        <Square value={[2]} />
      </div>
      <div className="board-row">
        <Square value={[3]} />
        <Square value={[4]} />
        <Square value={[5]} />
      </div>
      <div className="board-row">
        <Square value={[6]} />
        <Square value={[7]} />
        <Square value={[8]} />
      </div>
    </>
  );

  function Square() {
    function handleClick() {
      setValue("X");
    }
    return (
      <button className="square" onClick={handleClick}>
        {value}
      </button>
    );
  }
}
